Flashback from the Riyadh Fashion Week 2023. 🇸🇦 
So proud of myself that I took part in this amazing fashion show! I’m so thankful and grateful for this, and had the pleasure to walk for those amazing designers! 
Being an Arab Fashion Model and a Creative Person makes me so proud to see Arab countries are stepping into this industry and making huge steps towards the fashion world. 👏🏼
Was such a beautiful experience, had the best time and got to meet beautiful people and models who became like a family and as well as working with the most amazing team and designers! Can’t wait to see what else is coming next! 🤍
